import React, { useState, useEffect } from "react";
import { updatedProduto } from '../axios_helper';
import { Button, Card, CardHeader, CardBody, CardFooter, FormGroup, Form, Input, Row, Col } from "reactstrap";

function Produtos() {
  const [produto, setProduto] = useState({
    name: "",
    price: "",
    amount: "",
    description: "",
    image: ""
  });

  const handleInputChange = (e) => {
    const { name, value } = e.target;

    // Se o campo for 'price', adicione 'R$' na frente do valor
    setProduto(prevProduto => ({
      ...prevProduto,
      [name]: name === 'price' ? `R$ ${value}` : value
    }));
  };

  const handleSave = async () => {
    try {
      // Certifique-se de enviar o produto atualizado para a função
      await updatedProduto(produto);
      console.log("Produto criado com sucesso");
    } catch (error) {
      console.error("Erro ao criar o Produto:", error);
    }
  };

  return (
    <>
      <div className="content">
        <Row>
          <Col md="8">
            <Card>
              <CardHeader>
                <h5 className="title">Create product</h5>
              </CardHeader>
              <CardBody>
                <Form>
                  <Row>
                    <Col className="pr-md-1" md="12">
                      <FormGroup>
                        <label>Name</label>
                        <Input
                          name="name"
                          placeholder="Name"
                          type="text"
                          onChange={handleInputChange}
                        />
                      </FormGroup>
                    </Col>
                  </Row>
                  <Row>
                    <Col md="12">
                      <FormGroup>
                        <label>Image</label>
                        <Input
                          name="image"
                          placeholder="Image"
                          type="text"
                          onChange={handleInputChange}
                        />
                      </FormGroup>
                    </Col>
                  </Row>
                  <Row>
                    <Col md="7">
                      <FormGroup>
                        <label>Price</label>
                        <Input
                          name="price"
                          placeholder="R$"
                          type="text"
                          onChange={handleInputChange}
                        />
                      </FormGroup>
                    </Col>
                    <Col md="5">
                      <FormGroup>
                        <label>Amount</label>
                        <Input
                          name="amount"
                          placeholder="Amount"
                          type="number"
                          onChange={handleInputChange}
                        />
                      </FormGroup>
                    </Col>
                  </Row>
                  <Row>
                    <Col md="12">
                      <FormGroup>
                        <label>Description</label>
                        <Input
                          name="description"
                          placeholder="Description"
                          type="text"
                          onChange={handleInputChange}
                        />
                      </FormGroup>
                    </Col>
                  </Row>
                </Form>
              </CardBody>
              <CardFooter>
                <Button
                  className="btn-fill"
                  color="primary"
                  type="button"
                  onClick={handleSave}
                >
                  Save
                </Button>
              </CardFooter>
            </Card>
          </Col>
        </Row>
      </div>
    </>
  );
}

export default Produtos;
